import React, { Component } from 'react'
import "../../Css/Profile.css";
import { connect } from 'react-redux';
import PropTypes from 'prop-types';
import { showAllProject } from '../../actions/ProjectAction.js';
import NavName from './NavName'

 class Applicants extends Component {

    componentDidMount(){
        this.props.showAllProject();
    }
    componentWillReceiveProps(nextProps){
          
                this.setState({
                     profile: nextProps.profile,
                });
                
     }
    render() {
        const { project } = this.props.project; 
          
          
        return (
            <div className="profile">
                  <NavName pageName="Profile" pageDescription="Add or Update profile information."  />
               
            </div>
        )
    }
}


Applicants.propTypes = {
     showAllProject: PropTypes.func.isRequired,
  
};

const mapStateToProps = (state) => ({
  project: state.project,
});

export default connect(mapStateToProps, { showAllProject  })(Applicants);
